import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for a product price element using a different selector strategy (CSS class + partial text)
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Use $$eval to extract all visible product prices (using class and textContent)
    const prices = await page.$$eval('.product-price', nodes =>
      nodes
        .filter(node => node.offsetParent !== null)
        .map(node => {
          // Extract only the main price (ignore original/strikethrough)
          const priceText = node.childNodes[0]?.textContent || node.textContent || '';
          // Remove $ and commas, trim
          const match = priceText.match(/[\d,.]+/);
          return match ? match[0].replace(/,/g, '').trim() : priceText.trim();
        })
        .filter(Boolean)
    );

    // Take screenshot of the first product card if available
    const firstProductCard = await page.$('.product-card');
    if (firstProductCard) {
      const step2 = path.join(screenshotsDir, 'step_2_first_product_card.png');
      await firstProductCard.screenshot({ path: step2 });
      screenshots.push(step2);
    }

    // Also try extracting prices using XPath as a secondary strategy (in case some prices are missed)
    const priceHandles = await page.$$('//div[contains(@class,"product-price")]');
    for (const handle of priceHandles) {
      const box = await handle.boundingBox();
      if (box) {
        const step3 = path.join(screenshotsDir, `step_3_price_${Math.floor(box.y)}.png`);
        await handle.screenshot({ path: step3 });
        screenshots.push(step3);
        break; // Only one extra screenshot for demonstration
      }
    }

    return {
      success: true,
      action: "Extracted all visible product prices from the page using multiple selector strategies.",
      extractedData: { prices },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
